import React, { useState } from "react";
import emailjs from "emailjs-com";
import logo from "./assets/logo.png";
import qr from "./assets/qr.png";
import successImg from "./assets/success.png";

function App() {
  const [formData, setFormData] = useState({
    name: "",
    occupation: "",
    email: "",
    whatsapp: "",
    topic: "",
    datetime: "",
  });

  const [submitted, setSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    let base64Image = "";
    if (formData.screenshot) {
      const reader = new FileReader();
      reader.readAsDataURL(formData.screenshot);
      base64Image = await new Promise((resolve) => {
        reader.onload = () => resolve(reader.result);
      });
    }

    emailjs.send(
      "service_ted5m2h",
      "template_5qmfosa",
      {
        name: formData.name,
        email: formData.email,
      },
      "D8Cr-U9g1MVqsc5bv"
    );

    emailjs.send(
      "service_ted5m2h",
      "template_nzvxr9o",
      {
        name: formData.name,
        email: formData.email,
        occupation: formData.occupation,
        whatsapp: formData.whatsapp,
        problem: formData.problem,
        preferredTime: formData.preferredTime,
        screenshot: base64Image,
      },
      "D8Cr-U9g1MVqsc5bv"
    );

    setSubmitted(true);
  };

  return (
    <div className="bg-gradient-to-br from-[#0f2f2f] to-[#134040] text-[#f1f5f5] font-sans min-h-screen">
      {/* Header */}
      <header className="sticky top-0 z-50 bg-[#102828]/90 backdrop-blur-md shadow px-6 py-4 flex justify-between items-center">
        <div className="flex items-center gap-3">
          <img src={logo} alt="Logo" className="w-10 h-10" />
          <div>
            <h1 className="text-xl font-bold text-[#a0f0f0]">Ghar-ki-Baat</h1>
            <p className="text-sm text-[#ccecec]">Where Your Mind Finds Peace</p>
          </div>
        </div>
        <nav className="hidden md:flex gap-6 text-[#a0f0f0] font-medium">
          <a href="#home" className="hover:text-[#7ae0e0]">Home</a>
          <a href="#book" className="hover:text-[#7ae0e0]">Book</a>
          <a href="#contact" className="hover:text-[#7ae0e0]">Contact</a>
        </nav>
      </header>

      {/* Hero */}
      <section className="bg-[#1c3c3c] py-16 px-6 md:px-20 border-b border-[#336666]">
        <div className="max-w-6xl mx-auto flex flex-col md:flex-row items-center justify-between gap-8">
          <div className="md:w-1/2 mb-10 md:mb-0">
            <h2 className="text-4xl font-bold text-[#a0f0f0] mb-4">Welcome to Ghar-ki-Baat</h2>
            <p className="text-lg text-[#d8ffff]">A peaceful space to talk, share, and feel heard. We’re here for your thoughts — no judgment, just kindness.</p>
          </div>
          <div className="md:w-1/3">
            <img src={logo} alt="Hero Logo" className="w-48 h-48 animate-pulse" />
          </div>
        </div>
      </section>

      {/* What We Do Section */}
      <section id="home" className="p-10 max-w-4xl mx-auto text-center bg-[#244f4f] shadow-xl rounded-lg mt-10 border border-[#3c6f6f]">
        <h2 className="text-2xl font-bold text-[#d8ffff] mb-6">What We Do</h2>
        <ul className="space-y-3 text-lg text-[#e8fdfd]">
          <li>🎧 Listen to anything on your mind — school, life, overthinking, or just silence.</li>
          <li>💬 Make you feel lighter with calm, honest conversation.</li>
          <li>🌿 Give simple guidance or just a space to breathe — no pressure.</li>
        </ul>
      </section>

      {/* More sections continue as they were... */}
    </div>
  );
}

export default App;
